const Home = () => {
  const handleClick = () => {
    console.log("Hello world!");
  };
  const handleClickAgain  = (name) =>{
      console.log("Hello " + name)
  }
  return (
    <div className="Home">
      <h2>Homepage</h2>
      <button onClick = {handleClick}>Click me!</button>
        <button  onClick = {(name)=>{
            handleClickAgain(name)
        }}>Click me again!</button>
    </div>
  );
};

export default Home;
